import time

def minIncrementForUnique(A):
    path = {}
    ans = 0
    for x in A:
        #print(x)
        if path.__contains__(x):
            n = path[x]
            while path.__contains__(n):
                n = path[n]
            if path.__contains__(n+1):
                path[n] = path[n+1]
            else:
                path[n] = n+1
            path[x] = path[n]
            ans += n - x
        else:
            if path.__contains__(x+1):
                path[x] = path[x+1]
            else:
                path[x] = x+1
        #print(path)
    return ans

